import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Person from './Person/Person';

class App extends Component {
  persona = {
    person : [
      {name:'Andres', age:25 },
      {name:'Paula', age:24 },
      {name:'Sthepanie', age:26 }
    ]
  }
  render() {
    return (
      <div className="App">
        <h1> App usando react </h1>
        <Person name="{this.persona[0].name}" />
      </div>
    );
  }
}

export default App;
